import styled from '@emotion/styled'
import { GoArrowUp } from "react-icons/go";

const Styled = styled.div`
  svg {
    fill: #838383;
    cursor: pointer;
  }
`;

function Vote(props) {
  return (
    <Styled>
      <GoArrowUp />
    </ Styled>
  );
}

export default Vote;
